import {BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom'
function App() {
  return (
    <Router>
      <ul>
        <li>Home</li>
        <li>Contato</li>
      </ul>

      <Routes>
        <Route path exact="/">
          <Home/>
        </Route>


      </Routes>
      <p>Footer</p>
    </Router>
  );
}

export default App;
